  input: TEXT,"F3XA","","In response to FEC ltr, 8/18/2006:1)Three disbursements to
    candidate committes were incorrectly catagorized, by clerical error, as primary
    distributions, when in fact the distributions were for general elections purposes.
    These disbursements have been redesignated in this amendment.2)In response to
    the request for a detailed description of procedures for requesting 'best efforts'
    information, the Committee does first, for original solicitations, includes a
    clear and conspicuous request for contribution information and informs the contributor
    of the requirements of federal law for the reporting of such information. When
    information is not provided, the committee makes inquiries via e-mail or telephone
    (documented in writing), within 30 days of the receipt of the contribution. This
    contact asks for the missing information, without soliciting a contribution, and
    informs the contributor of the requirements of federal law for the reporting of
    such information. When information is received, the Committee database is then
    updated with the information for reporting as required. As suggested by our analyst,
    we will post 'best efforts' in fields where information has not been provided.3)All
    expenditures made for 'catering, meals,' Fundraising Catering,' and 'Fundraising
    Consultant' were in support of the People's House PAC exclusively. None of these
    expenditures were in support of federal candidates. 4)Expenditures for 'Fundraising
    Event Printing' were in support of the People's House PAC and did not contain
    express advocacy, public communications and voter drive activity referring to
    federal candidates.5)All expenses relative to administrative activity have been
    adequately disclosed. No office space is rented, and payroll is comprised of payments
    to an independent contractor. Incurred expenses for administrative purposes are
    disclosed as reimbursements, as they are incurred."
